import './todo.js';

function App() {
  return (
    <div class="container">
      <div id="myDIV" class="header">
        <h2 style={{margin:"5px"}}>My To Do List</h2>
        <input type="text" id="myInput" placeholder="Title..."/>
          <span onclick="addTodo" class="addBtn">Add</span>
      </div>

      <ul id="myUL">
        <li>Hit the gym</li>
        <li class="checked">Pay bills</li>
        <li>Meet George</li>
        <li>Buy eggs</li>
        <li>Read a book</li>
        <li>Organize office</li>
      </ul>

    </div>
  );
}

export default App;
